import axios from "axios";

function post_favorite(item, db) {
  axios.post("/favorites", { item, db })
  }

function get_favorite(requst){
  console.log(requst);
  return axios.get(`/${requst}`)
  
  }

export default {
  post_favorite,
  get_favorite
};
